import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function Order() {
    const location = useLocation();
    const navigate = useNavigate();

    // Datele comenzii primite din `state`
    const orderDetails = location.state?.order;

    if (!orderDetails) {
        return (
            <div>
                <h2>Eroare</h2>
                <p>Nu există detalii despre comandă. Vă rugăm să reveniți la pagina principală.</p>
                <button onClick={() => navigate('/')}>Înapoi la pagina principală</button>
            </div>
        );
    }

    return (
        <div>
            <h2>Detalii Comandă</h2>
            <p>Adresa de livrare: {orderDetails.shippingAddress}</p>
            <p>Data de livrare: {orderDetails.dateOfDelivery}</p>
            <h3>Mașinile comandate:</h3>
            <ul>
                {orderDetails.cars.map((car) => (
                    <li key={car.idCar}>
                        {car.model} - {car.price} EUR
                    </li>
                ))}
            </ul>
            <button onClick={() => navigate('/')}>Înapoi la pagina principală</button>
        </div>
    );
}

export default Order;
